export default function loginFormReducer(state = initialState, action) {
  switch (action.type) {
    case "SET_CURRENT_ACCOUNT":
    console.log(action.payload.attributes)
      return {...state, currentAccount: action.payload}
    case "CLEAR_CURRENT_ACCOUNT":
      return null 
